            <li>Iskusan zdravstveni tehničar odabire venu u lakatnoj jami i bezbolno uvodi iglu u venu. Igla je povezana s plastičnom vrećicom u koju se daje krv. Samo darivanje krvi traje 8 - 12 minuta. Igla i plastična vrećica za uzimanje krvi su sterilne i samo za jednokratnu uporabu, tj. mogu se primijetiti samo za jednokratno darivanje.</li>
            <li>Davatelju nakon darivanja krvi slijedi kratkotrajni odmor uz osvježenje i lagani obrok. Sveukupno, darivanje krvi vam može oduzeti oko 30 minuta vašeg vremena.</li>
